import React , {Component} from 'react';
class Items extends Component{
    render()
    {
      const {id,age,name} = this.props; 
      return (
        <div>
        <p>name</p>
        <p>id</p>
        <p>age</p>
        </div>
        )
    }
}
export default Items;
